import Nav from 'react-bootstrap/Navbar';
import img from '../Images/navlogo.jpg';
import { Container } from 'react-bootstrap';
function Navbar(){
    return(
        <>
           <Nav>
            <Container>

              <Nav.Brand aria-expanded={true}> 
              <img src={img} alt='navlogo'/>
              </Nav.Brand>
              <Nav.Toggle>

              </Nav.Toggle>
            </Container>
           </Nav>
        </>
    )
}

export default Navbar;
